            "currency": "USD",
            "minAverPrice": 654,
            "starsLevel": 2,
            "desc": "As one of the five largest hotels in Manhattan, the property holds an impressive history and offers an excellent Midtown location directly opposite Madison Square Garden and Amtrak\u0027s Penn Station. \nThe hotel was built in 1919 by the Pennsylvania Railroad and designed by the renowned firm of McKim, Mead and White, which also completed other landmark hotels in New York City such as Columbia University and the United States Post Office on 8th Avenue. \nThe hotel\u0027s location on 7th Avenue at 33rd Street is also within walking distance of the business, entertainment and fashion districts, including Macy\u0027s, the Empire State Building, Times Square and the Jacob Javits Center. In fact, New York\u0027s Hotel Pennsylvania is central to many attractions and events Among our 1,700 Midtown Manhattan hotel rooms at Hotel Pennsylvania, you?ll find our superior New York City accommodations to be a spacious home base for all of your NY adventures. From the moment you enter our hotel through a grand lobby to the minute you enter through a historic original guest room door from 1919 to the minute you check out of our hotel rooms in Midtown Manhattan you?ll enjoy a variety of comforts in the heart of Midtown. Breakfast for breakfast inclusive rates will be served at Caf\u00e9 R restaurant, located a few steps from the hotel. This landmark hotel was built in 1919 and is one of New York City\u0027s largest hotels. The style of the building is typical of the architecture during this time. The lobby is extremely large and bustling with activity, grand enterence with high ceilings and marble floors. It has recently undergone renovation and has been restored to its former traditional style.  The lobby also has a newsstand and gift shop and restaurant The hotel\u0027s midtown Manhattan location provides guests with convenient access to all the city\u0027s attractions and major shopping areas; only one block away from Madison Square and Macy\u0027s Herald Square. It is the most popular hotel with the international traveller on a budget. (0207\/MR) There is a facility fee applicable to some room types and payable directly to the hotel upon check out. The charge is between USD 11-15 per room per night for all reservations until March 31, 2017. PLEASE NOTE",
